import React from 'react';

const Weather = ({loading,weather}) => {
    if(loading)
        return <h1>Loading...</h1>
    return(
        <div>
    <p>Cloud:{weather.cloud}</p>

    <p>Temperature:{weather.temp_c}</p>
    <p>UV : {weather.UV}</p>
    </div>
    
    
    )};

export default Weather;
